import AdminMain from "./pages/AdminMain"
import AllPets from "./pages/AllPets"
import Auth from "./pages/Auth"
import Home from "./pages/Home"
import PersonalCabinet from "./pages/PersonalCabinet"
import Requests from "./pages/Requests"
import SomeForm from "./pages/SomeForm"
import Statistics from "./pages/Statistics"
import { ADMIN_MAIN_ROUTE, ALL_PETS_ROUTE, AUTH_ROUTE, HOME_ROUTE, PERSONAL_CABINET_ROUTE, REQUESTS_ROUTE, SOME_FORM_ROUTE, STATISTICS_ROUTE } from "./utils/consts"

export const clientRoutes = [
    {
        path: HOME_ROUTE,
        Component: Home
    },
    {
        path: ALL_PETS_ROUTE,
        Component: AllPets
    },
    {
        path: AUTH_ROUTE,
        Component: Auth
    },
    {
        path: PERSONAL_CABINET_ROUTE,
        Component: PersonalCabinet
    },
    {
        path: SOME_FORM_ROUTE,
        Component: SomeForm
    }
]

export const adminRoutes = [
    {
        path: AUTH_ROUTE,
        Component: Auth
    },
    {
        path: ADMIN_MAIN_ROUTE,
        Component: AdminMain
    },
    {
        path: REQUESTS_ROUTE,
        Component: Requests
    },
    {
        path: STATISTICS_ROUTE,
        Component: Statistics
    }
]
